import './App.css';

function App() {
  return (
    <div className="App">
      <div className="datos">
        <label>Codigo: <input type="text"></input></label><br/>
        <label>Nombre: <input type="text"></input></label><br/>
        <label>Apellido: <input type="text"></input></label><br/>
        <label>Celular: <input type="number"></input></label><br/>
        <label>Dirección: <input type="text"></input></label><br/>
        <button>Registrar</button>
      </div>
    </div>
  );
}

export default App;
